import React, { useEffect, useState } from 'react';
import './App.css';

type MilkInformation = {
  count: number;
  name: string;
  // temperatureC: number;
}

function App() {
  const [milkData, setMilkData] = useState<MilkInformation[]>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch(" https://localhost:7023/api/milk");
      const MilkResults = await response.json();
      setMilkData(MilkResults);
    }
    getData();
  }, [])
  console.log(milkData);
  // let bla = milkData.map(function(element){
  //   return `${element.name}`;
  // })
  // console.log(bla);


  return milkData.map((m) => {
    return <div>
             <h2>{m.count}</h2>
             <p>{m.name}</p>
           </div>;
  });
}

export default App;
